import React from 'react';
import Header from './components/Header';
import './LoginPage.css';
import loginImg1 from './assets/logo.png'; // Replace with your own images
import loginImg2 from './assets/logo.png'; // Replace with your own images

const LoginPage = () => (
  <>
    <Header />
    <div className="login-page-container">
      <div className="login-left">
        <h2>ENJOY THE BEST EXPERIENCE</h2>
        <p>Log in to enjoy a personalised experience and access all our services.</p>
        <button className="login-btn">LOG IN</button>
        <button className="register-btn">REGISTER</button>
      </div>
      <div className="login-right">
        <img src={loginImg1} alt="Login visual 1" className="login-img" />
        <img src={loginImg2} alt="Login visual 2" className="login-img" />
      </div>
    </div>
  </>
);

export default LoginPage;
